  def dateMultiLine(cx:Context) = {
    val scope = getScope(cx);
    var nowTime = LocalDate.of(2011, 10, 1);
    var futTime = LocalDate.of(2011, 10, 1);
    //val monthNames = Seq("Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec")
    val monthSub = Seq(20, 18, 15, 8, 5, 0, -8, -6, 0, 8, 10, 20);
    val sdf = DateTimeFormatter.ofPattern("yyyyMMdd")
    var datatsv = "date\tNew York\tSan Francisco\tAustin"
    var randVal = Math.random()
    for(i <- 1 to 366 ){ 
      if(randVal < 0.3 && randVal > 0.2)
        randVal =  1.0 + (Math.random()/50.0)
      else if(randVal > 0.9)
        randVal =  1.0 - (Math.random()/60.0)
      else if(randVal < 0.1)
        randVal =  1.0 + (Math.random()/30.0)
      else if(randVal < 0.2)
        randVal = 1.0 - (Math.random()/20.0)
      else
        randVal = 1.0 + (Math.random()/20.0)
      datatsv+= f"\n${futTime.format(sdf)}\t${((randVal)*100.0)-33.0-monthSub(futTime.getMonth.getValue-1)}%1.1f\t${(((randVal+(Math.random()/12.0)))*100.0)-30.0-monthSub(futTime.getMonth.getValue-1)}%1.1f\t${(((randVal+(Math.random()/10.0)))*100.0) -25.0- monthSub(futTime.getMonth.getValue-1)}%1.1f"
      futTime = nowTime.plusDays(i)
      randVal = Math.random()
    }
    //println(datatsv)
    scope.put("tsvdata", scope, datatsv);
    loadJS(cx, scope, "js/date_multi_line.js")
  }
  
  def outputSVG(svg:String){
    Files.write(Paths.get("svg.svg"), svg.getBytes(StandardCharsets.UTF_8))
    val htmlFile = new File("svg.svg");
    java.awt.Desktop.getDesktop().browse(htmlFile.toURI());
  }
  
  def outputHTML(html:String){
    Files.write(Paths.get("html.html"), html.getBytes(StandardCharsets.UTF_8))
    val htmlFile = new File("html.html");
    java.awt.Desktop.getDesktop().browse(htmlFile.toURI());
  }
  
  def outputPNG( svg:String){
    Files.write(Paths.get("svg.svg"), svg.getBytes(StandardCharsets.UTF_8))
    val svg_URI_input = Paths.get("svg.svg").toUri().toURL().toString();
    val input_svg_image = new TranscoderInput(svg_URI_input);        
    //Step-2: Define OutputStream to PNG Image and attach to TranscoderOutput
    val png_ostream = new FileOutputStream("png.png");
    val output_png_image = new TranscoderOutput(png_ostream);              
    // Step-3: Create PNGTranscoder and define hints if required
    val my_converter = new PNGTranscoder();        
    // Step-4: Convert and Write output
    my_converter.transcode(input_svg_image, output_png_image);
    // Step 5- close / flush Output Stream
    png_ostream.flush();
    png_ostream.close();        
    val pngFile = new File("png.png");
    java.awt.Desktop.getDesktop().browse(pngFile.toURI());
  }
  
  def outputPDF(svg:String){
    Files.write(Paths.get("svg.svg"), svg.getBytes(StandardCharsets.UTF_8))
    val svg_URI_input = Paths.get("svg.svg").toUri().toURL().toString();
    val input_svg_image = new TranscoderInput(svg_URI_input);        
    //Step-2: Define OutputStream to PDF file and attach to TranscoderOutput
    val pdf_ostream = new FileOutputStream("pdf.pdf");
    val output_pdf_file = new TranscoderOutput(pdf_ostream);               
    // Step-3: Create a PDF Transcoder and define hints
    val transcoder = new PDFTranscoder();
    // Step-4: Write output to PDF format
    transcoder.transcode(input_svg_image, output_pdf_file);
    // Step 5- close / flush Output Stream
    pdf_ostream.flush();
    pdf_ostream.close();
    val pdfFile = new File("pdf.pdf");
    java.awt.Desktop.getDesktop().browse(pdfFile.toURI());
  }
  
  var currentSvgDoc : SVGDocument = null
  var rootGN : GraphicsNode = null
  var svgPath : SVGOMPathElement = null
  def parseSvg(svg:String)  : SVGDocument = {
    val userAgent = new UserAgentAdapter();
    val loader = new DocumentLoader(userAgent);
    val ctx = new BridgeContext(userAgent, loader);
    ctx.setDynamicState(BridgeContext.DYNAMIC);
    val builder = new GVTBuilder();
    val reader = new StringReader(svg);
    val uri = Paths.get("svg.svg").toUri().toURL().toString();
    val parser = XMLResourceDescriptor.getXMLParserClassName();
	  val f = new SAXSVGDocumentFactory(parser);
	  val svgDoc = f.createSVGDocument(uri,reader);
	  rootGN = builder.build(ctx, svgDoc);
	  reader.close();
    currentSvgDoc = svgDoc
    svgPath = currentSvgDoc.getElementsByTagNameNS(SVGDOMImplementation.SVG_NAMESPACE_URI,"path").item(0).asInstanceOf[SVGOMPathElement]
    svgDoc
  }
  
  def getSVGPathTotalLength() : Float = {
    //val path = currentSvgDoc.getElementsByTagNameNS(SVGDOMImplementation.SVG_NAMESPACE_URI,"path").item(0).asInstanceOf[SVGOMPathElement]
    val length = svgPath.getTotalLength()
    //val length = SVGPathSupport.getTotalLength(path)
    length
  }
  
  def getSVGPathPointAtLength(len:Float) : String = {
    //val path = currentSvgDoc.getElementsByTagNameNS(SVGDOMImplementation.SVG_NAMESPACE_URI,"path").item(0).asInstanceOf[SVGOMPathElement]
    //val point = SVGPathSupport.getPointAtLength(path, len)
    //println("lenght------------->"+len)
    val point = svgPath.getPointAtLength(len)
    val ret = s"""{"x":${point.getX},"y":${point.getY}}"""
    //println("point------------->"+ret)
    ret
  }
  
  def createNewEnvironment() : ScriptableObject = {
        var global:Global = null;
        
        val cx = Context.enter();
        try {
            cx.setOptimizationLevel(OPTIMIZATION_LEVEL);
            cx.setLanguageVersion(JS_VERSION);
            
            global = new Global();
            global.setSealedStdLib(true);
            global.init(cx);

            val argsObj = cx.newArray(global, Array[Object]());
            global.defineProperty("arguments", argsObj, ScriptableObject.DONTENUM);
            
            // Enable RequireJS
            loadJS(cx, global, "js/r.js");

            // Load the bootstrap file
            loadJS(cx, global, "js/bootstrap.js");
            
            global.sealObject();
        } catch {
          case e: Throwable => LOG.error("Error setting up Javascript environment", e);
        }
        finally {
            Context.exit();
        }
        global;
    }
    
    def loadJS( cx:Context,  scr:Scriptable,  fileName:String) = {
        var reader:Reader = null;
        try {
            reader = new InputStreamReader(new FileInputStream(new File(fileName)), Charsets.UTF_8);
        } catch {
          case e:FileNotFoundException =>
            throw new Exception("Could not find file", e);
        };
        
        try {
            cx.evaluateReader(scr, reader, fileName, 0, null);
        } catch {
          case e: Throwable => throw new Exception("IO error reading file", e);
        }
        finally {
            try { reader.close(); } catch {
              case e: Throwable =>
                throw new Exception("IO error closing file", e);
            }
        }
    }
    
    def  getScope( cx:Context) : Scriptable = {
        val scope = cx.newObject(ENVIRONMENT);
        scope.setPrototype(ENVIRONMENT);
        scope.setParentScope(null);
        scope;
    }
}

